import React from 'react';
import './Sidebar.css';

const menuItems = [
  { icon: 'üöö', label: 'Dashboard' },
  { icon: '', label: 'Fleet Management' },
  { icon: '', label: 'Oil Management' },
  { icon: '', label: 'City Operations' },
  { icon: '', label: 'User Management' },
  { icon: '', label: 'Analytics' },
  { icon: '', label: 'Settings' },
  { icon: '', label: 'Logout' },
];

export default function Sidebar() {
  return (
    <aside className="sidebar">
      <div className="logo">
        <span>üõ¢Ô∏è</span>
        <div>
          <div className="logo-title">OilFlow</div>
          <div className="logo-subtitle">Admin Panel</div>
        </div>
      </div>
      <nav className="sidebar-nav">
        {menuItems.map((item, idx) => (
          <div
            key={item.label}
            className={`sidebar-item${idx === 0 ? ' active' : ''}`}
          >
            <span className="sidebar-icon">{item.icon}</span>
            {item.label}
          </div>
        ))}
      </nav>
    </aside>
  );
}
